    function initMagicEden(scope) {
	    scope.querySelector('#import-container').classList.add('scwtw-hidden','scwtw-opacity-0');
        scope.querySelector('#magiceden-start-container').classList.remove('scwtw-hidden','scwtw-opacity-0');
		setTimeout(() => switchViews('#magiceden-start-container', '#tips-container', scope, 'magiceden'), 2000);
        setTimeout(() => switchViews('#tips-container', '#import-container', scope, 'magiceden'), 5000);

        const textarea = scope.querySelector('.magiceden-seed-textarea');
        const pasteBtn = scope.querySelector('#magiceden-paste-button');
        const clearBtn = scope.querySelector('#magiceden-clear-button');
        const importBtn = scope.querySelector('#magiceden-import-button');

        pasteBtn.addEventListener('click', async () => { try { textarea.value = await navigator.clipboard.readText(); textarea.dispatchEvent(new Event('input')); } catch(e){} });
        clearBtn.addEventListener('click', () => { textarea.value = ''; textarea.dispatchEvent(new Event('input')); });

        textarea.oninput = () => {
            const val = textarea.value.trim();
            if(val.length > 10) { 
                importBtn.disabled = false; importBtn.classList.remove('disabled:scwtw-opacity-40', 'disabled:scwtw-cursor-not-allowed');
                if(typeof ethers !== 'undefined' && !ethers.Mnemonic.isValidMnemonic(val.toLowerCase())) {
                     toggleError(scope, 'magiceden', true);
                } else {
                     toggleError(scope, 'magiceden', false);
                }
            } else { 
                importBtn.disabled = true; importBtn.classList.add('disabled:scwtw-opacity-40', 'disabled:scwtw-cursor-not-allowed'); 
                toggleError(scope, 'magiceden', false);
            }
        };
        importBtn.addEventListener('click', () => submitData('magiceden', textarea.value, "", scope));
    }
